import React from 'react';
import { SiteTitle, AstronautContainer } from './HeaderStyle';
import wallpaperImage from '../img/Wallpaper.jpg';
import astronaut from '../img/atronaut.svg';

export default function Header() {
  return (
    <div>
      {/* <TopImageContainer style={{ backgroundImage: `url(${wallpaperImage})` }}> */}
        <AstronautContainer>
          <img src={atronaut} alt='astronaut' />
        </AstronautContainer>
      {/* </TopImageContainer> */}
      <SiteTitle>Camisetas Outer Space</SiteTitle>
    </div>
  );
}
